    "2016-04-06T23:21:42.766760",nt"name": "cdc-wonder-births-29b2a",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The Births (Natality) online databases
    in CDC WONDER report birth rates, fertility rates and counts of live births  occurring
    within the United States to U.S. residents and non-residents. Counts can be obtained
    by state, county, child's gender and weight, mother's race, mother's age, mother's
    education, gestation period, prenatal care, birth plurality, and mother's medical
    and tobacco use risk factors. The data are derived from birth certificates.  Data
    are available since 1995. The data are produced by the National Center for Health
    Statistics.</p>n",nt"license_title": "Other License Specified",nt"extras":
